	render() {
		return (
			<div>
				<div style={{ textAlign: center }}>
					<h1>Stop Wasting Precious Time with Design We did the hard part for you.</h1>
					<p>Swap in some text and images and you're done!</p>
				</div>
				<Proj />
				<div>
					<a href="#">More</a>
				</div>
			</div>
		);
	}
}
export default Project;
